import React, {Component} from 'react'; 
import{ImageBackground} from'react-native'
class fondo extends Component{
    state={};

    render(){
        return(
            <div className="App">
                <ImageBackground src={this.props.foto}>
                </ImageBackground>               
            </div>            
        )
    }
}
export default fondo;
